import React from 'react';
import ReactDOM from 'react-dom';
import './landing.css';
import * as serviceWorker from './serviceWorker';

const Landing = () => {
  var create_account_expand = create_account_expand => {
    var elems = document.getElementsByClassName("createAccount");
    for (var i = 0; i < elems.length;  i++)  {
      elems[i].style.visibility = "visible";
      elems[i].style.height = "auto";
    }
  }
    return (
        <div class="login">
            <h1>Email Address</h1>
            <form onSubmit="">
              <label>
                <input type="text" onChange="" />
              </label>
            </form>
            <div class="createAccount">
              <h1>Confirm Email Address</h1>
              <form onSubmit="">
                <label>
                  <input type="text" onChange="" />
                </label>
              </form>
            </div>
            <h1>Password</h1>
            <form onSubmit="">
              <label>
                <input type="text" onChange="" />
              </label>
            </form>
            <div class="createAccount">
              <h1>Confirm Password</h1>
              <form onSubmit="">
                <label>
                  <input type="text" onChange="" />
                </label>
              </form>
            </div>
            <button onClick="">Login</button>
            <button onClick={create_account_expand}>Sign up</button>
            <button onClick="" class="createAccount">Create Account</button>
        </div>
    );
}

export default Landing;
